import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './home';  // Import the Home component

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Home} />  {/* Show Home component at the root route */}
        {/* Add more routes here for other pages, like login, registration, etc. */}
      </Switch>
    </Router>
  );
}

export default App;
